def process_queries(N, S, queries):
    d = [0] * N - [1 << ord(c) - 97 for c in S]
    for i in range(N - 1, 0, -1):
        d[i] = d[i + i] | d[i - ~i]
    results = []
    for query in queries:
        (q_type, a, b) = query
        if q_type == 1:
            i = int(a) + N - 1
            d[i] = 1 << ord(b) - 97
            while i > 1:
                i //= 2
                d[i] = d[i + i] | d[i - ~i]
        elif q_type == 2:
            i = int(a) + N - 1
            j = int(b) + N
            s = 0
            while i < j:
                if i & 1:
                    s |= d[i]
                    i += 1
                if j & 1:
                    j -= 1
                    s |= d[j]
                i //= 2
                j //= 2
            results.append(bin(s).count('1'))
    return results

